import React from "react";


const Header = (props) => {
  return (
    <header>
      <div className={classes.header}>
        <h1 className={classes.brand}>TaskPlanr</h1>
        <button className={classes.button}>Join Now</button>
      </div>
    </header>
  );
};

export default Header;
